INSERT INTO `definitions` VALUES (3,'إذا كانت لديك أسئلة حول الباطنية ، ناظور البطن ، العجز الجنسي ، العقم عند الذكور ، علاج بالمنظار ، فحص البول ، جراحة تكبير القضيب, جراحة ناظور البطن ، جراحة البروستاتا ، الحجر ، جراحة البروستاتا ، شق جراحي ، علاج المشاكل الجنسية ، العجز الجنسي ، العقم، جراحة المسالك البولية للنساء والرجال، الجراحة وعلاج أمراض سرطان الكلى ، المثانة ، البروستاتا ، الخصية ، مشاكل المسالك البولية ، مثل التهابات المسالك البولية للأطفال وحصى الكلى ,أطفال مثلي الجنس، يمكنك أن تسأل الأطباء في هذا القسم.',10,'2019-12-20 08:09:12','2020-01-14 23:52:02'),(5,'إذا كانت لديك أسئلة حول تحديد جنس الجنين ، والعقم ، والإخصاب خارج المختبر ، وناظور البطن ، والعناية قبل الحمل وبعده - علاج العقم واضطرابات الحوض - إجراء جميع العمليات الجراحية النسائية وأمراض النساء والولادة وصحة الانجاب واستشارات العجز الجنسي، يمكنك أن تسأل الأطباء في هذا القسم.',4,'2020-01-14 22:06:56','2020-01-14 23:29:41'),(6,'إذا كان لديك أسئلة في مجال أمراض الجلد والشعر - حقن الجل والبوتوكس. الليزر - نصائح حول الجمال والتجديد ، زراعة الشعر ، الليزر ، تجديد الليزر ، تحلل الدهون ، جراحة الليزر وإزالة الشعر بالليزر ، يمكنك سؤال الأطباء في هذا القسم.',8,'2020-01-14 23:33:45','2020-01-14 23:33:45'),(7,'إذا كانت لديك أسئلة حول العجز الجنسي والعقم وجراحة مسالك البول للرجال والنساء وجراحة الدوالي والمثانة والبروستاتا والخصية ، يمكنك سؤال الأطباء في هذا القسم.',9,'2020-01-14 23:38:17','2020-01-14 23:38:17'),(8,'إذا كانت لديك أسئلة حول الإرشاد الأسري ، والاستشارة قبل الزواج ، وعلاج الانهيار العاطفي ، والعلاج الزوجي ، وحل النزاعات الزوجية ، والاستشارات قبل الطلاق وبعده ، وتحسين العلاقات الشخصية ، والتدريب على المهارات الزوجية ، الاستشارة الشخصية ، التدريب على المهارات الحياتية ، الاستشارة الإيجابية ، السعادة واحترام الذات ، الزواج ، علاقات الأزواج ، تدريب الأطفال ، نمط الحياة ، يمكنك سؤال الأطباء في هذا القسم.',5,'2020-01-14 23:55:24','2020-01-14 23:55:24'),(9,'إذا كانت لديك أسئلة حول أمراض الغدد الصماء والتمثيل الغذائي - تشخيص وعلاج الأمراض الداخلية والغدد الصماء والتمثيل الغذائي والغدة الدرقية والسكري والأمراض الهرمونية والغدد والنمو والتغذية والسمنة وضغط الدم وضغط الدم والكبد الدهني ، يمكنك أن تسأل الأطباء في هذا القسم.',12,'2020-01-14 23:58:59','2020-01-14 23:58:59'),(10,'إذا كانت لديك أسئلة حول الجهاز الهضمي والكبد والمرارة والناظور والبنكرياس و القولون ، فيمكنك أن تسأل الأطباء في هذا القسم.',13,'2020-01-15 00:00:21','2020-01-15 00:00:21'),(11,'إذا كانت لديك أسئلة حول الاضطرابات الداخلية والرئة والجهاز التنفسي ، فيمكنك سؤال الأطباء في هذا القسم.',53,'2020-01-15 00:02:07','2020-01-15 00:02:07'),(12,'إذا كانت لديك أسئلة حول علاج الأزواج ، والتنويم المغناطيسي السريري ، والعلاج النفسي ، وتقديم المشورة للمراهقين ، والتحليل النفسي ، فيمكنك سؤال الأطباء في هذا القسم.',11,'2020-01-15 00:03:00','2020-01-15 00:03:00'),(13,'إذا كانت لديك أسئلة حول التغذية أو النظام الغذائي أو السمنة ، فيمكنك سؤال الأطباء في هذا القسم.',2,'2020-01-15 00:03:57','2020-01-15 00:03:57'),(14,'إذا كانت لديك أسئلة حول الفيزيولوجيا العصبية السريرية للأطفال وأمراض الأطفال وحديثي الولادة والربو والحساسية والتغذية بالتطعيم خاصة بالنسبة للخدج ، ومشاكل الجهاز التنفسي الحادة ، ومشاكل القلب والأوعية الدموية والتمثيل الغذائي ، وجراحة العظام للأطفال وجراحة العمود الفقري ، فيمكنك أن تسأل الأطباء في هذا القسم.',14,'2020-01-15 00:05:13','2020-01-15 00:05:13'),(15,'إذا كانت لديك أسئلة حول أمراض الأعصاب للأطفال وعلم الأعصاب ومرض الزهايمر والجمجمة ، فيمكنك أن تسأل الأطباء في هذا القسم.',15,'2020-01-15 00:07:04','2020-01-15 00:07:04'),(16,'إذا كانت لديك أسئلة حول الدم أو السرطان أو الأورام، يمكنك أن تسأل الأطباء في هذا القسم.',16,'2020-01-15 00:08:28','2020-01-15 00:08:28'),(17,'إذا كانت لديك أسئلة حول الأمراض الوراثية والخلقية ، والاستشارات الوراثية قبل الزواج ، قبل الحمل وأثناءه ، وتحديد السبب الوراثي للأمراض الخلقية والوراثية بما في ذلك التخلف العقلي مثل التوحد ومتلازمة داون ، والصم ، والعمى ، وشلل عضلات وراثية مثل CP ، Duchenne و SMA ، أمراض التمثيل الغذائي، أمراض الجلد الوراثية مثل EB ,وأمراض النزف مثل الهيموفيليا، تقديم المشورة لإجراء الاختبارات الوراثية التشخيصية للوقاية ,يمكنك سؤال الأطباء في هذا القسم.',17,'2020-01-15 00:13:50','2020-01-15 00:13:50'),(18,'إذا كانت لديك أسئلة حول الجراحة وجراحة العظام والتهاب المفاصل ، يمكنك أن تسأل الأطباء في هذا القسم.',18,'2020-01-15 00:14:50','2020-01-15 00:14:50'),(19,'إذا كانت لديك أسئلة حول الإصابة بالسرطان وزرع الأعضاء ، تشخيص وعلاج الحمى المطولة ، الرئوية ، الجلد ، المسالك البولية ، الجماع ، الجهاز الهضمي ، الطفيلي ، التهاب الكبد ، عدوى فيروس - تشخيص وعلاج الجروح المعدية والتهابات القدم السكرية - نصيحة بشأن الاتصال غير الجنسي ,عدوى عالية الخطورة ومنتقلة بالاتصال الجنسي ، يمكنك سؤال الأطباء في هذا القسم.',19,'2020-01-15 00:17:06','2020-01-15 00:17:06'),(20,'إذا كانت لديك أسئلة حول جراحة الأنف والأذن والحنجرة وجراحة الرأس والعنق والتهاب الجيوب الأنفية، فيمكنك أن تسأل الأطباء في هذا القسم.',20,'2020-01-15 00:20:02','2020-01-15 00:20:02'),(21,'إذا كانت لديك أسئلة حول شبكية العين ، وجراحة العين ، وأمراض العين والالتهابات ، وتشوهات العين ، والعدسات الطبية واللون ، وكسل العين ، والنظارات والعدسات ، يمكنك استشارة الأطباء في هذا القسم.',21,'2020-01-15 00:21:16','2020-01-15 00:21:16'),(22,'إذا كانت لديك أسئلة حول الربو والحساسية والمناعة ، فيمكنك سؤال الأطباء في هذا القسم.',22,'2020-01-15 00:22:23','2020-01-15 00:22:23'),(23,'إذا كانت لديك أسئلة حول أمراض الغدد الصماء والتمثيل الغذائي - تشخيص وعلاج الأمراض الداخلية والغدد الصماء والتمثيل الغذائي والغدة الدرقية والسكري والأمراض الهرمونية والغدد والنمو والتغذية والسمنة والتخسيس وضغط الدم وضغط الدم والكبد الدهني ، يمكنك أن تسأل الخبراء في هذا المجال.',24,'2020-01-15 00:24:15','2020-01-15 00:24:15'),(24,'في اضطرابات العظام والمفاصل ، فإن من الأهمية أن يتم تشخيص حالة طفلك وعلاجه هو العلاج في الوقت المناسب. يمكنك أن تسأل أخصائيي جراحة العظام للأطفال هنا عن طريق الإنترنت للأجابة عن أسئلتك ومخاوف حول عظام طفلك واضطرابات المفاصل.قد يتورط الأطفال المتنامون في اضطرابات في أنظمتهم الهيكلية والمفصلية لعدة أسباب. يمكن أن تتأثر أجزاء مختلفة من جسم الطفل ، مثل أصابع القدم والركبتين والفخذين والعمود الفقري والرقبة والكتفين والمرفقين والمعصمين والأصابع.',25,'2020-01-15 00:29:27','2020-01-15 00:29:27'),(25,'الأطفال عند الولادة وفي مرحلة الطفولة قد يعانون من أمراض القلب. اعتمادًا على نوع مرض القلب وشدته ، قد تظهر الأعراض المبكرة لمشاكل القلب الخلقية عند الأطفال في بعض الأحيان وتتضح في حالات أخرى. لذلك يجب عليك استشارة طبيب قلب الأطفال لطفلك بشكل دوري. تجدر الإشارة إلى أنه إذا لم تفهم مشكلة قلب طفلك ولم تتخذ الخطوات اللازمة,يمكن أن تشمل أمراض القلب عند الأطفال انثقاب الأذين (ASD) ، بطء القلب (معدل ضربات القلب البطيء وغير الطبيعي) ، القناة الشريانية المفتوحة (PDA) ، تشوهات صمام القلب.',26,'2020-01-15 00:31:52','2020-01-15 00:31:52'),(26,'عندما تتجاوز نسبة الدهون في الكبد 10 ٪ ، فإنه يعتبر الكبد دهني. يمكن أن يحدث في الرجال والنساء وحتى الأطفال. هناك العديد من العوامل التي تجعل الكبد الدهني ، معظمه يتعلق بنمط الحياة (لايف ستايل). العوامل الأخرى التي تزيد من احتمالية إصابة الكبد بالدهون هو السكري وبعض الأدوية. الشيء المهم في الكبد الدهني هو أنه صامت ، مما يعني أنه لا توجد أعراض مبكرة واضحة. لذلك تحتاج إلى الاتصال بطبيبك بشكل دوري. الأطباء في في هذا القسم ​​مستعدون للاستجابة على على جميع اسألتكم ومخاوفكم بشأن الكبد الدهني.',27,'2020-01-15 00:36:15','2020-01-15 00:36:15'),(27,'نوعان من فيروس الورم الحليمي البشري: HPV16 و HPV18 هما أخطر نماذج الثآليل التناسلية. هذا المرض شديد العدوى وينتقل من شخص إلى آخر عبر الجماع المهبلي والشرجي والشفوي فاستشر الأطباء المختصين لدينا للوقاية من فيروس الورم الحليمي البشري وفيروس نقص المناعة البشرية. أيضًا ، إذا كنت تشك في فيروس الورم الحليمي البشري وفيروس نقص المناعة البشري، فأنت بحاجة إلى أن تكون متخصصًا في العلاج والاختبار ، فأطباءنا في هذا القسم على استعداد لخدمتك.',28,'2020-01-15 00:39:17','2020-01-15 00:39:17'),(28,'شدة الصداع النصفي لدى بعض الناس شديدة لدرجة أنه يمكن أن يسبب الدوخة والغثيان والقيء. يشعر الأشخاص الذين يعانون من الصداع الشديد بألم في أجزاء مختلفة من رؤوسهم ، ويعاني الكثير منا من ألم في الظهر, هناك عدة طرق لعلاج أو علاج الصداع النصفي والصداع ، ولكن يجب أن تستند إلى خصائصك الجسدية والعقلية ، لذا يجب عليك التحدث مع أخصائي حول طرق علاج الصداع النصفي والصداع. يمكنك الحصول على مشورة من أطباء هذا القسم المختصين حول الصداع أو الصداع نصفي.',29,'2020-01-15 00:42:09','2020-01-15 00:42:09'),(29,'يمكنك الحصول على برنامج نظام غذائي عبر الإنترنت من اختصاصي التغذية. أخصائيو التغذية لدينا على استعداد لتقديم نظام غذائي مصمم خصيصا لحالتك البدنية. فيما يلي بعض الوجبات الغذائية التي يوصي بها خبراؤنا: حمية التخسيس ، حمية الدهون ، حمية الكيتون ، حمية الحليب ، حمية البيض ، حمية البطاطس ، كمال الأجسام ، التغذية الرياضية ، حمية أتكينز ، حمية البروتين ، حمية التخسيس البطنية والجانبية والنظام الغذائي الخالي من الكربوهيدرات وغيرها من الوجبات الغذائية',31,'2020-01-15 00:44:48','2020-01-15 00:44:48'),(30,'إذا كانت لديك أسئلة حول علم السموم والحساسية والأشعة والموجات فوق الصوتية والتصوير بالرنين المغناطيسي والتصوير المقطعي ، فيمكنك أن تسأل الأطباء في هذا القسم.',49,'2020-01-15 00:46:41','2020-01-15 00:46:41'),(31,'إذا كان لديك أسئلة حول الأعشاب، يمكنك أن تسأل الأطباء في هذا القسم.',46,'2020-01-15 00:49:02','2020-01-15 00:49:02'),(32,'إذا كانت لديك أسئلة حول العظام والمفاصل وأمراض الروماتيزم ، يمكنك أن تسأل الأطباء في هذا القسم.',43,'2020-01-15 00:50:02','2020-01-15 00:50:02'),(33,'إذا كانت لديك أسئلة حول الأدوية، والآثار الجانبية ، وجميع المعلومات حول الأدوية ، يمكنك أن تسأل الصيادلة في هذا القسم.',44,'2020-01-15 00:51:18','2020-01-15 00:51:18'),(34,'إذا كان لديك أسئلة حول العلاج الطبيعي ، يمكنك أن تسأل الأطباء في هذا القسم.',51,'2020-01-15 00:52:24','2020-01-15 00:52:24'),(35,'إذا كانت لديك أسئلة حول الجهاز الهضمي والكبد والمرارة والناظور والبنكرياس و القولون ، فيمكنك أن تسأل الأطباء في هذا القسم.',54,'2020-01-15 00:55:01','2020-01-15 00:55:01'),(37,'إذا كانت لديك أسئلة حول الجراحة التجميلية ووتجديد الليزر وازالة الدهون وجراحة الليزر وإزالة الشعر بالليزر ، فيمكنك أن تسأل الأطباء في هذا القسم.',56,'2020-01-15 00:58:31','2020-01-15 00:58:31'),(38,'إذا كانت لديك أسئلة حول تجميل الأنف والحنجرة والرأس والعنق والأنف البلاستيكي وجراح الوجه وجراحة الأنف والجيوب الأنفية ، فيمكنك سؤال الأطباء في هذا القسم.',57,'2020-01-15 00:59:30','2020-01-15 00:59:30'),(39,'إذا كانت لديك أسئلة حول طب الأسنان وطب الأسنان للأطفال ، تبييض الأسنان ، علاج الأسنان وعلاج الجذر، فيمكنك سؤال الأطباء في هذا القسم.',58,'2020-01-15 01:00:25','2020-01-15 01:00:25'),(40,'يمكنك الحصول على برنامج نظام غذائي عبر الإنترنت من اختصاصي التغذية. أخصائيو التغذية لدينا على استعداد لتقديم نظام غذائي مصمم خصيصا لحالتك البدنية. فيما يلي بعض الوجبات الغذائية التي يوصي بها خبراؤنا: حمية التخسيس ، حمية الدهون ، حمية الكيتون ، حمية الحليب ، حمية البيض ، حمية البطاطس ، كمال الأجسام ، التغذية الرياضية ، حمية أتكينز ، حمية البروتين ، حمية التخسيس البطنية والجانبية والنظام الغذائي الخالي من الكربوهيدرات وغيرها من الوجبات الغذائية',2,'2020-02-11 19:51:28','2020-02-11 19:51:28');
